import MainDash from './Components/MainDash/MainDash';
import RightSide from './Components/RightSide/RightSide';
import SideBar from './Components/SideBar';

function App() {
  return (
    <div className="App">

      <div className="appGlass">
        <SideBar/>

        <RightSide/>
      </div>

    </div>
  );
}

export default App;
